import React from 'react';
import './App.css';
import DataTable from 'react-data-table-component';


const columns = [
  {
    name: 'Id',
    selector: row => row.id,
    sortable: true,
  },
  {
    name: 'First Name',
    selector: row => row.firstName,
    sortable: true,
  },
  {
    name: 'Last Name',
    selector: row => row.lastName,
    sortable: true,
  },
  {
    name: 'Email',
    selector: row => row.email,
    sortable: true,
  },
  {
    name: 'Phone',
    selector: row => row.phone,
    sortable: true,
  },
  {
    name: 'State',
    selector: row => row.state,
    sortable: true,
  },
];

const data = [
  {
    id: 1,
    firstName: 'Beetlejuice',
    lastName: '1988',
    email: 'adc@sdcsdc',
    phone: 732329283,
    state: 'ddqvqq',
  },
  {
    id: 2,
    firstName: 'Ghostbusters',
    lastName: '1984',
    email: 'casds@sdcds',
    phone: 847393,
    state: 'csdc',
  },
]

function App() {
  return (
    <DataTable
      columns={columns}
      data={data}
      pagination
    />
  );
};
export default App;
